import React from 'react';
import { Link } from 'react-router-dom'; 
import './App.css';
import {ReactIconsProvider,defaultIcons,SocialIcon} from 'react-icons-context';
import { FaGithubSquare,FaLinkedin } from 'react-icons/fa';


/*https://www.freecodecamp.org/news/react-router-tutorial/*/
class Navbar extends React.Component {
    render(){
    return(
        <div className="Navbar">
                {/* Set up the Links*/}
                <div className="compass"></div>
                <div className="btn-group">
                        <Link to="/Projects" className="item"><button class="button">Home</button></Link>
                        <Link to="/resume" className="item"><button class="button">Resume</button></Link>
                        <Link to="/about" className="item"><button class="button">About</button></Link>
                </div>
                <div className="NavRight">
                <ReactIconsProvider value={defaultIcons}>
                        <button  class="social"><FaGithubSquare height="3em"/></button>
                        <SocialIcon url="https://github.com/wgannon" />
                        {/* <a href="https://github.com/wgannon" className="item2"><button  class="social"><FaGithubSquare heigh="3em"/></button></a> */}
                        {/* <a href="https://www.linkedin.com/in/william-gannon-62704189/" className="item2"><button class="social"><FaLinkedin /></button></a> */}
                </ReactIconsProvider>
                </div>
            </div>
            
    )
    }
}
export default Navbar;
